import './App.css';
import React, { useState,useEffect } from 'react';
import Navbar from './components/Navbar'
import Container from './components/Container'
import Proptypes from "prop-types"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  BrowserRouter
}from"react-router-dom";

function App() {
const prevent=(event)=>{
  event.preventDefault();
}
  return (
<>
<BrowserRouter>
<Navbar prevent={prevent}></Navbar>
<div>
<Routes>
  <Route exact path='/' key="/" category=""  element={<Container></Container>}>
  </Route>
  <Route exact path='/home' key="home" category="" element={<Container></Container>}>
  </Route>
  <Route exact path='/jewelery' key="jewelery" category="cajewelery" element={<Container></Container>}>
  </Route>
  <Route exact path='/electronics' key="electronics" category="electronics" element={<Container></Container>}>
  </Route>
  <Route exact path='men clothing' key="men clothing" category="men's%20clothing" element={<Container></Container>}>
  </Route>
  <Route exact path='/women clothing' key="women clothing" category="women's%20clothing" element={<Container></Container>}>
  </Route>
</Routes>
</div>
</BrowserRouter>
</>
  );
}

export default App;
